import React from 'react';
import Slider from '@material-ui/core/Slider';
import styles from './TripList.module.css';


export default function SiteSlider ({tripListData}) {

  return (
    <div className={styles.sliderContainer}>
      <div>Sport: <Slider className={styles.slider} disabled max={5} defaultValue={tripListData.slider.sport} aria-labelledby="continuous-slider" />{tripListData.slider.sport}</div>
      <div>Monuments: <Slider className={styles.slider} disabled max={5} defaultValue={tripListData.slider.monuments} aria-labelledby="continuous-slider" /></div>
      <div>Party: <Slider className={styles.slider} disabled max={5} defaultValue={tripListData.slider.party} aria-labelledby="continuous-slider" /></div>
      <div>Hotels: <Slider className={styles.slider} disabled max={5} defaultValue={tripListData.slider.hotels} aria-labelledby="continuous-slider" /></div>
      <div>Restaurants: <Slider className={styles.slider} disabled max={5} defaultValue={tripListData.slider.restaurants} aria-labelledby="continuous-slider" /></div>
    </div>
  );
}
